import React from "react";
import SearchKakaoMap from "./components/kakao/SearchKakaoMap";
import SearchNaverMap from "./components/naver/SearchNaverMap";

// import './components/css/map.css';

const App = () => (
    <div className="App">
        <h1>카카오 맵 검색</h1>
        <SearchKakaoMap />

        <br/>

        <h1>네이버 지도 검색</h1>
        <SearchNaverMap />
    </div>
);

export default App;
